On the more Rust-y side of things the wasm-bindgen crate is designed to ideally have as minimal impact on a Rust crate as possible. Ideally a few #[wasm_bindgen] attributes are annotated in key locations and otherwise you're off to the races. The attribute strives to both not invent new syntax and work with existing idioms today. For example a library might exposed a function in normal Rust that looks like: pub fn greet(name: &str) -> String { // ...
} And with #[wasm_bindgen] all you need to do in exporting it to JS is: #[wasm_bindgen]
pub fn greet(name: &str) -> String { // ...
} Additionally the design here with minimal intervention in Rust should allow us to easily take advantage of the upcoming host bindings proposal. Ideally you'd simply upgrade wasm-bindgen -the-crate as well as your toolchain and you're immediately getting raw access to host bindings! (this is still a bit of a ways off though...)

