The stack in foo.js is, well, a stack. JS objects are pushed on the top of the stack, and their index in the stack is the identifier that's passed to wasm. JS objects are then only removed from the top of the stack as well. This data structure is mainly useful for efficiently passing a JS object into wasm without a sort of "heap allocation". The downside of this, however, is that it only works for when wasm doesn't hold onto a JS object (aka it only gets a "reference" in Rust parlance). Let's take a look at an example. // foo.rs
#[wasm_bindgen]
pub fn foo(a: &JsValue) { // ...
} Here we're using the special JsValue type from the wasm-bindgen library itself. Our exported function, foo , takes a reference to an object. This notably means that it can't persist the object past the lifetime of this function call. Now what we actually want to generate is a JS module that looks like (in Typescript parlance) // foo.d.ts
export function foo(a: any); and what we actually generate looks something like: // foo.js
import * as wasm from './foo_bg'; const stack = []; function addBorrowedObject(obj) { stack.push(obj); return stack.length - 1;
} export function foo(arg0) { const idx0 = addBorrowedObject(arg0); try { wasm.foo(idx0); } finally { stack.pop(); }
} Here we can see a few notable points of action: The wasm file was renamed to foo_bg.wasm , and we can see how the JS module generated here is importing from the wasm file. Next we can see our stack module variable which is used to push/pop items from the stack. Our exported function foo , takes an arbitrary argument, arg0 , which is converted to an index with the addBorrowedObject object function. The index is then passed to wasm so wasm can operate with it. Finally, we have a finally which frees the stack slot as it's no longer used, issuing a pop for what was pushed at the start of the function. It's also helpful to dig into the Rust side of things to see what's going on there! Let's take a look at the code that #[wasm_bindgen] generates in Rust: // what the user wrote
pub fn foo(a: &JsValue) { // ...
} #[export_name = "foo"]
pub extern fn __wasm_bindgen_generated_foo(arg0: u32) { let arg0 = unsafe { ManuallyDrop::new(JsValue::__from_idx(arg0)) }; let arg0 = &*arg0; foo(arg0);
} And as with the JS, the notable points here are: The original function, foo , is unmodified in the output A generated function here (with a unique name) is the one that's actually exported from the wasm module Our generated function takes an integer argument (our index) and then wraps it in a JsValue . There's some trickery here that's not worth going into just yet, but we'll see in a bit what's happening under the hood.

