The above strategy is useful when JS objects are only temporarily used in Rust, for example only during one function call. Sometimes, though, objects may have a dynamic lifetime or otherwise need to be stored on Rust's heap. To cope with this there's a second half of management of JS objects, a slab. JS Objects passed to wasm that are not references are assumed to have a dynamic lifetime inside of the wasm module. As a result the strict push/pop of the stack won't work and we need more permanent storage for the JS objects. To cope with this we build our own "slab allocator" of sorts. A picture (or code) is worth a thousand words so let's show what happens with an example. // foo.rs
#[wasm_bindgen]
pub fn foo(a: JsValue) { // ...
} Note that the & is missing in front of the JsValue we had before, and in Rust parlance this means it's taking ownership of the JS value. The exported ES module interface is the same as before, but the ownership mechanics are slightly different. Let's see the generated JS's slab in action: import * as wasm from './foo_bg'; // imports from wasm file const slab = [];
let slab_next = 0; function addHeapObject(obj) { if (slab_next === slab.length) slab.push(slab.length + 1); const idx = slab_next; const next = slab[idx]; slab_next = next; slab[idx] = { obj, cnt: 1 }; return idx;
} export function foo(arg0) { const idx0 = addHeapObject(arg0); wasm.foo(idx0);
} export function __wbindgen_object_drop_ref(idx) { let obj = slab[idx]; obj.cnt -= 1; if (obj.cnt > 0) return; // If we hit 0 then free up our space in the slab slab[idx] = slab_next; slab_next = idx;
} Unlike before we're now calling addHeapObject on the argument to foo rather than addBorrowedObject . This function will use slab and slab_next as a slab allocator to acquire a slot to store the object, placing a structure there once it's found. Note here that a reference count is used in addition to storing the object. That's so we can create multiple references to the JS object in Rust without using Rc , but it's overall not too important to worry about here. Another curious aspect of this generated module is the __wbindgen_object_drop_ref function. This is one that's actually imported from wasm rather than used in this module! This function is used to signal the end of the lifetime of a JsValue in Rust, or in other words when it goes out of scope. Otherwise though this function is largely just a general "slab free" implementation. And finally, let's take a look at the Rust generated again too: // what the user wrote
pub fn foo(a: JsValue) { // ...
} #[export_name = "foo"]
pub extern fn __wasm_bindgen_generated_foo(arg0: u32) { let arg0 = unsafe { JsValue::__from_idx(arg0) }; foo(arg0);
} Ah that looks much more familiar! Not much interesting is happening here, so let's move on to...

