The js-sys crate provides raw bindings to all the global APIs guaranteed to exist in every JavaScript environment by the ECMAScript standard, and its source lives at wasm-bindgen/crates/js-sys . With the js-sys crate, we can work with Object s, Array s, Function s, Map s, Set s, etc... without writing the #[wasm_bindgen] imports by hand. Documentation for this crate will eventually be available on docs.rs but temporarily you can also check out the master branch documentation for the crate. For example, we can invoke JavaScript Function callbacks and time how long they take to execute with Date.now() , and we don't need to write any JS imports ourselves: extern crate js_sys;
