Sometimes the discipline of stack-lifetime closures is not desired. For example, you'd like to schedule a closure to be run on the next turn of the event loop in JavaScript through setTimeout . For this, you want the imported function to return but the JavaScript closure still needs to be valid! For this scenario, you need the Closure type, which is defined in the wasm_bindgen crate, exported in wasm_bindgen::prelude , and represents a "long lived" closure. The Closure type is currently behind a feature which needs to be enabled: [dependencies]
wasm-bindgen = {version = "^0.2", features = ["nightly"]} The validity of the JavaScript closure is tied to the lifetime of the Closure in Rust. Once a Closure is dropped, it will deallocate its internal memory and invalidate the corresponding JavaScript function so that any further attempts to invoke it raise an exception. Like stack closures a Closure supports both Fn and FnMut closures, as well as arguments and returns. #[wasm_bindgen]
extern { fn setInterval(closure: &Closure<FnMut()>, millis: u32) -> f64; fn cancelInterval(token: f64); #[wasm_bindgen(js_namespace = console)] fn log(s: &str);
} #[wasm_bindgen]
pub struct Interval { closure: Closure<FnMut()>, token: f64,
} impl Interval { pub fn new<F>(millis: u32, f: F) -> Interval where F: FnMut() { // Construct a new closure. let closure = Closure::new(f); // Pass the closuer to JS, to run every n milliseconds. let token = setInterval(&closure, millis); Interval { closure, token } }
} // When the Interval is destroyed, cancel its `setInterval` timer.
impl Drop for Interval { fn drop(&mut self) { cancelInterval(self.token); }
} // Keep logging "hello" every second until the resulting `Interval` is dropped.
#[wasm_bindgen]
pub fn hello() -> Interval { Interval::new(1_000, || log("hello"));
}

