extern crate wasm_bindgen;
use wasm_bindgen::prelude::*; #[wasm_bindgen]
pub fn collect_numbers(some_iterable: &JsValue) -> Result<js_sys::Array, JsValue> { let nums = js_sys::Array::new(); let iterator = match js_sys::try_iter(some_iterable)?.ok_or_else(|| { "need to pass iterable JS values!".into() })?; for x in iterator { // If the iterator's `next` method throws an error, propagate it // up to the caller. let x = x?; // If `x` is a number, add it to our array of numbers! if x.is_f64() { nums.push(&x); } } Ok(nums)
}

